import React, {Component} from 'react';

class Contact extends Component    {
    constructor(props){
        super(props);
    }

    render(){
        return <div>{this.props.contact.number} {this.props.contact.email} {this.props.contact.onlineProfile}</div>;
    }
}

export default Contact;
